import styled from 'styled-components'

   export const AppContainer = styled.div`
        min-height: 100vh;
        width: 100%;
        display: flex;
        flex-direction: column;
    `;

    export const MainContainer = styled.main`
        align-self: center;
        overflow: hidden
        flex-basis: auto;
    `;
